    [],nt"revision_timestamp": "2015-05-06T22:17:20.055129",nt"name": "long-life-high-energy-cell-development-project",nt"isopen":
    true,nt"url": null,nt"notes": "NASA has a need to develop higher energy
    density battery systems to meet the power requirements of future energy devices.
     In this proposed Phase I program, PSI will develop an advanced cathode electrode
    structure that allows for the construction of lithium ion cells with long life (&gt;250
    cycles) and energy densities &amp;#61619;265Wh/kg.  The novel cathode electrode
    will reduce detrimental reactions with the electrolyte at high voltages that result
    in inefficient cycling and enhance performance fade.  Initially, PSI will demonstrate
    the feasibility of the proposed approach by constructing and performing steady state
    cycling of lab sized silicon/cathode cells.  This testing will highlight the ability
    to construct cells that can maintain their performance over hundreds of cycles.
     Scale-up of the optimized processes will then be carried out to support construction
    of prototype Ah sized cells and demonstrate MRL and TRLs of 4.  Phase II efforts
    would focus on construction of larger cells, demonstrating the cycling performance,
    and the readiness of the technology for integration into prototype battery packs
    for initial field testing.",nt"license_title": "U.S. Government Work",nt"extras":
